import React from 'react';
import './servicesC.css';
import Img1 from '../../../src/image/Img1.png'
import Img2 from '../../../src/image/Img2.png'
import Img3 from '../../../src/image/Img3.png'
import Img4 from '../../../src/image/Img4.png'
const ServicesC = () => {
    return (
          <div className="servicesTopComponent">
            <h1>Tous les services</h1>
              <div className="ServicesComponent">
                <div className="serviceCom">
                    <img src={Img4} alt="" />
                    <h3>DÉPANNAGE & RÉPARATION</h3>
                    <hr />
                    <p>Un problème de plomberie, d'électricité, de serrurerie… ? Chez bin_edk, nous avons la solution ! Notre service de dépannage est assuré.Demandez votre dépannage en ligne ou par téléphone : un artisan est missionné en 20 minutes et intervient dans les deux heures.</p>
                    <hr />
                    <button className='ButtonService'>Décrivez votre besoin</button>
                 </div>
                <div className="serviceCom">
                    <img src={Img2} alt="" />
                    <h3>PETITS TRAVAUX</h3>
                    <hr />
                    <p>Monter un meuble ? Accrocher votre miroir sur un mur carrelé, poser du carrelage ou repeindre un mur ? Vous pouvez faire appel à nos Pros des petits travaux qui seront là pour vous proposer leur savoir-faire et avec toujours la garantie d'un travail bien fait !</p>
                    <hr />
                    <button className='ButtonService'>Décrivez votre besoin</button>
                </div>
                <div className="serviceCom">
                    <img src={Img1} alt="" />
                    <h3>NETTOYAGE</h3>
                    <hr />
                    <p>Nettoyage de vitres, nettoyage de bureaux, nettoyage de restaurants, nettoyage d’hôtels à Riyad, nettoyage de bâtiments, de logements (nettoyage d’appartements, de maisons, de villas, etc...)</p>
                    <hr  style={{marginTop:'20px'}} />
                    <button className='ButtonService'>Décrivez votre besoin</button>
                </div>
                <div className="serviceCom">
                    <img src={Img3} alt="" />
                    <h3>SECURITE</h3>
                    <hr />
                    <p>Problème de sécurité ? Chez bin_edk, nous avons la solution ! Notre service de sécurité est fourni. Demandez votre intervention en ligne ou par téléphone : La sécurité privée est attribuée dans les 20 minutes et intervient dans les deux heures.</p>
                    <hr  style={{marginTop:'10px'}}/>
                    <button className='ButtonService'>Décrivez votre besoin</button>
                </div>
              </div>
          </div>




















        // <div className="services" >
        //     <div className="awesome">
